import React from 'react'
import './style/mainLogo.css'

import imglogo from './photo/Logo/logo.svg'
function MainLogo() {
  return (
    <div className='logo__container'>
      <img src={imglogo} alt="" />
    </div>
  )
}

export default MainLogo
